import React, { Component } from "react";
import { Icon } from "antd";

class Dashboard extends Component {
  render() {
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: "column",
          height: "100vh",
          width: "100vw"
        }}
      >
        <div
          style={{
            fontWeight: "bold",
            fontSize: "4vw",
            fontFamily: "BlinkMacSystemFont"
          }}
        >
          Dashboard
        </div>
        <div
          style={{
            fontSize: "1.2vw",
            fontFamily: "BlinkMacSystemFont"
          }}
        >
          Address
        </div>
        <div
          style={{
            fontSize: "1.2vw",
            fontFamily: "BlinkMacSystemFont"
          }}
        >
          Balance
        </div>
        <div
          style={{
            fontSize: "1.2vw",
            fontFamily: "BlinkMacSystemFont"
          }}
        >
          Ether Address
        </div>
        <div
          style={{
            fontSize: "1.2vw",
            fontFamily: "BlinkMacSystemFont"
          }}
        >
          Ether Balance
        </div>
        <Button type="primary" />
        <div style={{ display: "flex", flexDirection: "row" }}>
          <div
            style={{
              fontSize: "2vw",
              fontFamily: "BlinkMacSystemFont"
            }}
          >
            Campaigns
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
